def find_time_table_without_students(teat_name):
    i = 0
    now = datetime.now().date()
    while i < len(sched_w_st):
        for j in sched_w_st[i].values():
            if teat_name == j and (sched_w_st[i - 1]['date'] == sched_w_st[i]['date'])\
            and (sched_w_st[i - 1]['time'] != sched_w_st[i]['time']):
                if sched_w_st[i]['date'] == str(now) and now.isoweekday() == 1:
                    print(f"{sched_w_st[i]['subject']}\n{sched_w_st[i]['type']}\n{sched_w_st[i]['place']}\n"
                          f"{sched_w_st[i]['time']}\nпонедельник\n")
        i += 1
